‘Believer’ with @madeaux is Out Now on @thefactory93 

We’ve been working on this record on and off for almost 3 years. We are both thrilled to release it. Hope Y’all Like it !

Play it loud, Play it in the car, Play it to your kids, Play it to your friends, Play it to your loved ones, Play it to your parents, Play it <3 

I’ll be back on the road next week
